description:
One lonely man, six billion sex-crazed vampires. Be careful what you wish for!

It came without warning. The virus wiped out most of the world's population in just a few days, and everyone who survived became a vampire with an insatiable thirst for sex. Everyone except Robby. He's the last normal man in a world of unbridled sexuality, and he's a virgin...
